import React from "react";
import { Link } from "react-router-dom";
import homeicon from "../images/homeicon.png";
import searchicon from "../images/searchicon.png";
import foldericon from "../images/foldericon.png";
import mailicon from "../images/mailicon.png";
import capicon from "../images/capicon.png";
import "./styles/Navbar.css";

function Navbar(props) {
    let imageArray = [];
    imageArray.push(searchicon);
    imageArray.push(foldericon);
    imageArray.push(mailicon);
    imageArray.push(capicon);

    let linkArray = [];
    linkArray.push("/AboutMe");
    linkArray.push("/Portfolio");
    linkArray.push("/Contact");
    linkArray.push("/Experience");

    var second_btn = props.second;
    var third_btn = props.third;
    var fourth_btn = props.fourth;

    return(
        <div className="Navbar">
            <Link to="/">
                <img className="button" src={homeicon}/>
            </Link>

            <Link to={linkArray[second_btn]}>
                <img className="button" src={imageArray[second_btn]}/>
            </Link>

            <Link to={linkArray[third_btn]}>
                <img className="button" src={imageArray[third_btn]}/>
            </Link>

            <Link to={linkArray[fourth_btn]}>
                <img className="button" src={imageArray[fourth_btn]}/>
            </Link>
        </div>
    );
}

export default Navbar;
